  true,\n\t\"url\": null,\n\t\"notes\": \"MAPSS (Mapped Atmosphere-Plant-Soil System)
  is a landscape to global vegetation distribution model that was developed to simulate
  the potential biosphere impacts and biosphere-atmosphere feedbacks from climatic
  change. Model output from MAPSS has been used extensively in the Intergovernmental
  Panel on Climate Change's (IPCC) regional and global assessments of climate change
  impacts on vegetation and in several other projects.\",\n\t\"license_title\": \"U.S.
